import styled from "styled-components";
import { Button } from "../../../../components/button/Button";

type ProjecType = {
	src: string;
	alt: string;
	title: string;
	text: string;
	btnLink: string;
	btnTitle: string;
};

export function Project(props: ProjecType) {
	return (
		<StyledProject>
			<Image src={props.src} alt={props.alt} />
			<Title>{props.title}</Title>
			<Text>{props.text}</Text>
			<Button btnTitle={props.btnTitle} btnLink={props.btnLink} />
		</StyledProject>
	);
}

type StyledProjectType = {
	bgc
}

const StyledProject = styled.div`
	background-color: #70555b;
	max-width: 1040px;
	max-height: 447px;
`;

const Image = styled.img`
	width: 100%;
	height: 260px;
	object-fit: cover;
`;

const Title = styled.h3``;

const Text = styled.p``;

